import React, { useEffect, useState } from "react";
import Vector from "../../assets/images/Vector.png";
import cloths from "../../assets/images/cloths.png";
import bgCategories from "../../assets/images/bg-categories.png";
import { getAllCategories } from "../../services/categories";
import { setupAxios } from "../../utils/axiosClient";
import Loader from "../../components/Loader/loader";
import NoData from "../../components/noData/noData";
import { json, Link } from "react-router-dom";

export default function PopularCategories() {
  const [category, setCategory] = useState([]);
  const [loading, setLoading] = useState(true);

  const capitalizeWords = (str) => {
    if (!str) return '';
    return str
      .toLowerCase()
      .split(' ')
      .map((word) => word.charAt(0).toUpperCase() + word.slice(1))
      .join(' ');
  };

  const getCategories = async () => {
    setupAxios();
    try {
      setLoading(false);
      const res = await getAllCategories();
      setCategory(res?.data?.results);
    } catch (error) {
      setLoading(false);
    }
  };

  useEffect(() => {
    getCategories();
  }, []);

  return (
    <div className="container mx-auto py-10 lg:py-6">
      <div className="flex justify-center items-center">
        <h2 className="text-[#000000] text-center">
          <span className="text-xl lg:text-2xl block font-bold mb-1">
            Popular categories
          </span>
          <span className="text-2xl lg:text-4xl font-semibold relative">
            <span className="gradient font-black"> Browse Top </span> Categories
            <img
              className="flex justify-end absolute right-0 -bottom-5 h-[28px]"
              src={Vector}
              alt="arrow"
            />
          </span>
        </h2>
      </div>
      {category?.length === 0 ? (
        <NoData />
      ) : (
        <div className="abs">
          <img src={bgCategories} alt="Categories-Image" className=""/>
          <div
            className="grid lg:grid-cols-4 2xl:grid-cols-6 gap-8 py-6 lg:py-10 my-10  w-full"
          // data-aos="flip-right"
          >
            {console.log("Things inside category = " + JSON.stringify(category))}
            {console.log("Things inside category = " + category)}
            {loading ? (
              <Loader />
            ) : (
              category?.map((item, index) => {
                // console.log("Item at index " + index +" is "+ JSON.stringify(item));
                console.log("Item at index " + index + " is " + JSON.stringify(item));

                return (
                  <Link
                    key={item?.id}
                    to={`/businessList?category=${item?.name}`}
                    onClick={() => window.scrollTo(0, 0)}
                    className="border hover:border-[#287BB7] rounded-md"
                  >
                    <div
                      className="bg-white max-h-[250px] min-h-[250px] rounded-md box-shadow2 flex items-center justify-center flex-col p-10"
                    >
                      <div className="flex justify-center items-center w-full h-full">
                        <img src={cloths} alt="cloths" className="mb-4" />
                      </div>
                      <div className="">
                        <h2 className="text-2xl text-center font-bold mb-1 gradient w-full h-full flex justify-center items-center">
                          {capitalizeWords(item?.name)}
                        </h2>
                        <p className="text-[#9B9B9B] mx-auto text-center text-[15px] font-medium">
                          607 Items
                        </p>
                      </div>
                    </div>
                  </Link>
                );
              })
            )}
          </div>
        </div>
      )}
    </div>
  );
}

